\Response;\n\nclass EmployeeController extends Controller implements HasMiddleware\n{\n    use MultimediaTrait;\n    use UserTrait;\n\n    private OrchestratorHandlerContract $orchestratorHandler;\n    private ActionExecutorHandler $actionExecutorHandler;\n\n    public function __construct(\n        OrchestratorHandlerContract $orchestrators,\n        ActionExecutorHandler $actionExecutorHandler,\n        ImageManagerInterface $imageManager,\n        ViewFactory $viewFactory,\n        LoggerInterface $logger,\n    ) {\n        parent::__construct($logger, $viewFactory);\n        $this->setImageManager($imageManager);\n\n        $this->orchestratorHandler = $orchestrators;\n        $this->actionExecutorHandler = $actionExecutorHandler;\n    }\n\n    public function index(): JsonResponse|string\n    {\n        $view = $this->viewFactory->make('employee.index')\n            ->with('pagination', $this->getPagination())\n            ->render();\n\n        return $this->renderView($view);\n    }\n\n    public function getEmployees(Request $request): JsonResponse\n    {\n        return $this->orchestratorHandler->handler('retrieve-employees', $request);\n    }\n\n    public function changeStateEmployee(Request $request): JsonResponse\n    {\n        try {\n            \/** @var Employee $employee *\/\n            $employee = $this->orchestratorHandler->handler('change-state-employee', $request);\n        } catch (Exception $exception) {\n            $this->logger->error('Employee can not be updated with id: '.$request->input('id'), $exception->getTrace());\n\n            return new JsonResponse(status: Response::HTTP_INTERNAL_SERVER_ERROR);\n        }\n\n        $userId = $employee->userId()->value();\n        if (isset($userId)) {\n\n            $request->merge([\n                'userId' => $userId,\n                'state' => $employee->state()->value()\n            ]);\n\n            $this->orchestratorHandler->handler('change-state-user', $request);\n            UserUpdateOrDeleteEvent::dispatch($userId);\n        }\n\n        return new JsonResponse(status:Response::HTTP_CREATED);\n    }\n\n    public function getEmployee(Request $request, ?int $employeeId = null): JsonResponse|string\n    {\n        $request->merge(['employeeId' => $employeeId]);\n        $dataEmployee = $this->orchestratorHandler->handler('detail-employee', $request);\n\n        $view = $this->viewFactory->make('employee.employee-form', $dataEmployee)\n            ->render();\n\n        return $this->renderView($view);\n    }\n\n    public function storeEmployee(StoreEmployeeRequest $request): JsonResponse\n    {\n        try {\n            $method = (! $request->filled('employeeId')) ? 'create-employee-action' : 'update-employee-action';\n\n            \/** @var Employee $employee *\/\n            $employee = $this->actionExecutorHandler->invoke($method, $request);\n\n            EmployeeUpdateOrDeletedEvent::dispatch($employee->id()->value());\n            UserUpdateOrDeleteEvent::dispatch($employee->userId()->value());\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n\n            return new JsonResponse(\n                ['msg' => 'Ha ocurrido un error al guardar el registro, consulte con su administrador de sistemas'],\n                Response::HTTP_INTERNAL_SERVER_ERROR\n            );\n        }\n\n        return new JsonResponse(\n            [\n                'userId' => $employee->userId()->value(),\n                'employeeId' => $employee->id()->value(),\n            ],\n            Response::HTTP_CREATED\n        );\n    }\n\n    public function setImageEmployee(Request $request): JsonResponse\n    {\n        $random = Str::random(10);\n        $imageUrl = $this->saveImageTmp($request->file('file')->getRealPath(), $random);\n\n        return new JsonResponse(['token' => $random, 'url' => $imageUrl], Response::HTTP_CREATED);\n    }\n\n    public function deleteEmployee(Request $request, int $employeeId): JsonResponse\n    {\n        $request->merge(['employeeId' => $employeeId]);\n\n        \/** @var Employee $employee *\/\n        $employee = $this->orchestratorHandler->handler('retrieve-employee', $request);\n\n        try {\n\n            $this->orchestratorHandler->handler('delete-employee', $request);\n            $this->deleteImage($employee->image()->value());\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n\n            return new JsonResponse(status: Response::HTTP_INTERNAL_SERVER_ERROR);\n        }\n\n        $userId = $employee->userId()->value();\n        if (isset($userId)) {\n            $request->merge(['userId' => $userId]);\n            $this->orchestratorHandler->handler('delete-user', $request);\n        }\n\n        return new JsonResponse(status: Response::HTTP_OK);\n    }\n\n    \/**\n     * Get the middleware that should be assigned to the controller.\n     *\/\n    public static function middleware(): Middleware|array\n    {\n        return [\n            new Middleware(['auth', 'verify-session']),\n            new Middleware('only.ajax-request', only: [\n                'getEmployees', 'setImageEmployee', 'deleteEmployee', 'changeStateEmployee', 'storeEmployee',\n            ]),\n        ];\n    }\n}\n","mutants":[{"id":"4840aaf4bd5804cb6bb408637b604680","mutatorName":"MethodCallRemoval","replacement":"","description":"Removes the method call.","location":{"start":{"line":39,"column":9},"end":{"line":39,"column":52}},"status":"Killed","statusReason":"PHPUnit 10.5.20 by Sebastian Bergmann and contributors.\n\nRuntime:       PHP 8.2.20\nConfiguration: \/tmp\/infection\/phpunitConfiguration.4840aaf4bd5804cb6bb408637b604680.infection.xml\n\nEEEEEEEEE........                                                 17 \/ 17 (100%)\n\nTime: 00:00.206, Memory: 42.50 MB\n\nThere were 9 errors:\n\n1) Tests\\Feature\\App\\Http\\Controllers\\Em ction getProfiles(Request $request): JsonResponse\n    {\n        return $this->orchestratorHandler->handler('retrieve-profiles', $request);\n    }\n\n    public function changeStateProfile(Request $request): JsonResponse\n    {\n        try {\n            \/** @var Profile $profile *\/\n            $profile = $this->orchestratorHandler->handler('change-state-profile', $request);\n\n            ProfileUpdatedOrDeletedEvent::dispatch($profile->id()->value());\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n\n            return new JsonResponse(status: Response::HTTP_INTERNAL_SERVER_ERROR);\n        }\n\n        return new JsonResponse(status: Response::HTTP_OK);\n    }\n\n    public function deleteProfile(Request $request, int $id): JsonResponse\n    {\n        try {\n            $request->merge(['profileId' => $id]);\n\n            $this->orchestratorHandler->handler('delete-profile', $request);\n            ProfileUpdatedOrDeletedEvent::dispatch($id);\n\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n\n            return new JsonResponse(status:Response::HTTP_INTERNAL_SERVER_ERROR);\n        }\n\n        return new JsonResponse(status: Response::HTTP_OK);\n    }\n\n    public function getProfile(Request $request, ?int $id = null): JsonResponse\n    {\n        $request->merge(['profileId' => $id]);\n        $dataProfile = $this->orchestratorHandler->handler('detail-profile', $request);\n\n        $view = $this->viewFactory->make('profile.profile-form', $dataProfile)\n            ->render();\n\n        return $this->renderView($view);\n    }\n\n    public function storeProfile(StoreProfileRequest $request): JsonResponse\n    {\n        try {\n            $method = (is_null($request->input('profileId'))) ? 'create-profile-action' : 'update-profile-action';\n\n            \/** @var Profile $profile *\/\n mployee' => $employee,\n                ]);\n\n                if ($request->ajax()) {\n                    return new JsonResponse(status:ResponseSymfony::HTTP_OK);\n                }\n\n                return new RedirectResponse('\/home');\n            }\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n        }\n\n        return ! $request->ajax() ?\n            new RedirectResponse('\/login') :\n            new JsonResponse(['message' => 'Bad credentials'], ResponseSymfony::HTTP_BAD_REQUEST);\n    }\n\n    public function home(): JsonResponse|string\n    {\n        $view = $this->viewFactory->make('home.index')->render();\n        return $this->renderView($view);\n    }\n\n    public function logout(): RedirectResponse\n    {\n        $this->guard->logout();\n\n        $this->session->flush();\n        $this->session->invalidate();\n        $this->session->regenerateToken();\n\n        return new RedirectResponse(route('panel.login'));\n    }\n\n    private function getEmployee(Request $request, User $user): Employee\n    {\n        $request->merge(['employeeId' => $user->employeeId()->value()]);\n        return $this->orchestratorHandler->handler('retrieve-employee', $request);\n    }\n\n    \/**\n     * @throws ProfileNotActiveException\n     *\/\n    private function getProfile(Request $request, User $user): Profile\n    {\n        $request->merge(['profileId' => $user->profileId()->value()]);\n\n        $profile = $this->orchestratorHandler->handler('retrieve-profile', $request);\n\n        if ($profile instanceof Profile && $profile->state()->isInactivated()) {\n            $this->logger->warning(\"User's profile with id: \".$profile->id()->value().' is not active');\n            throw new ProfileNotActiveException('User is not authorized, contact with administrator');\n        }\n\n        return $profile;\n    }\n\n    \/**\n     * Get the middleware that should be assigned to nuse Illuminate\\Config\\Repository as Config;\nuse Illuminate\\Contracts\\Session\\Session;\nuse Illuminate\\Routing\\Router;\nuse Illuminate\\Support\\Str;\nuse Illuminate\\View\\View;\n\nclass MenuComposer\n{\n    private ModuleFactoryContract $moduleFactory;\n    private Config $config;\n    private Router $router;\n    private Session $session;\n    private string $imagePathFull;\n\n    public function __construct(\n        ModuleFactoryContract $moduleFactory,\n        Config $config,\n        Router $router,\n        Session $session\n    ) {\n        $this->moduleFactory = $moduleFactory;\n        $this->config = $config;\n        $this->router = $router;\n        $this->session = $session;\n        $this->imagePathFull = '\/images\/full\/';\n    }\n\n    public function compose(View $view): void\n    {\n        \/** @var User $user *\/\n        $user = $this->session->get('user');\n\n        \/** @var Profile $profile *\/\n        $profile = $this->session->get('profile');\n        \/** @var Employee $employee *\/\n        $employee = $this->session->get('employee');\n\n        $menu = $this->prepareMenu($profile->modules());\n        $image = url($this->imagePathFull.$user->photo()->value().'?v='.Str::random(10));\n\n        $view->with('menu', $menu);\n        $view->with('user', $user);\n        $view->with('employee', $employee);\n        $view->with('profile', $profile);\n        $view->with('image', $image);\n    }\n\n    private function prepareMenu(Modules $modules): array\n    {\n        $menuWithChildren = [];\n        $menuUnique = [];\n        foreach ($this->config->get('menu.options') as $index => $item) {\n            $item['id'] = 0;\n\n            if (is_null($item['route'])) {\n                $options = $modules->moduleElementsOfKey($index);\n\n                if (count($options)) {\n                    $item['key'] = $index;\n                    $item['route'] = '';\n\n                    $mainModule = $this->changeExpandedToModule($options, $this->getModuleMenu($item));\n\n                    $menuWithChildren[] = $mainModule;\n                }\n            } else {\n                $item['key'] = '';\n                $menuUnique[] = $this->getModuleMenu($item);\n            }\n        }\n\n        return array_merge($menuWithChildren, $menuUnique);\n    }\n\n    private function getModuleMenu(array $data): Module\n    {\n        return $this->moduleFactory->buildModule(\n            $this->moduleFactory->buildModuleId($data['id']),\n            $this->moduleFactory->buildModuleMenuKey($data['key']),\n            $this->moduleFactory->buildModuleName($data['name']),\n            $this->moduleFactory->buildModuleRoute($data['route']),\n            $this->moduleFactory->buildModuleIcon($data['icon']),\n        );\n    }\n\n    \/**\n     * @param  array<Module>  $modules\n     *\/\n    private function changeExpandedToModule(array $modules, Module $mainModule): Module\n    {\n        $routeCurrent = $this->router->current()->uri();\n\n        foreach ($modules as $item) {\n            if ($item->route()->value() === $routeCurrent) {\n                $item->setExpanded(true);\n                $mainModule->setExpanded(true);\n            }\n        }\n        $mainModule->setOptions($modules);\n\n        return $mainModule;\n    }\n}\n","mutants":[{"id":"7ffea81044404100b66972d2d81b94b0","mutatorName":"PublicVisibility","replacement":"protected function compose(View $view): void","description":"Replaces the `public` method visibility keyword with `protected`.","location":{"start":{"line":38,"column":5},"end":{"line":38,"column":46}},"status":"NoCoverage","statusReason":"","coveredBy":[],"killedBy":[],"testsCompleted":0},{"id":"c0859214ed82dd1d7b48fb6b3bede773","mutatorName":"Concat","replacement":"$image = url($user->photo()->value() . $this->imagePathFull . '?v=' . Str::random(10));","description":"Flips the operands of the string concatenation operator `.`. For example:\n\n```php\n'foo' . 'bar';\n` nd by id '. $id->value());\n        }\n    }\n\n    \/**\n     * @throws Throwable\n     *\/\n    public function getAll(array $filters = []): Institutions\n    {\n        $this->domainToPersist = Institutions::class;\n\n        try {\n            return $this->read(__FUNCTION__, $filters);\n        } catch (Exception $exception) {\n            throw new InstitutionsNotFoundException('Institutions not found');\n        }\n    }\n\n    public function delete(InstitutionId $id): void\n    {\n        $this->write(__FUNCTION__, $id);\n    }\n\n    public function persistInstitution(Institution $institution): Institution\n    {\n        return $this->write(__FUNCTION__, $institution);\n    }\n\n    public function functionNameDelete(): bool\n    {\n        return false;\n    }\n}\n","mutants":[{"id":"f004b0ea9d304b0a4ad9a5d083da0490","mutatorName":"Concat","replacement":"throw new InstitutionNotFoundException($id->value() . 'Institution not found by id ');","description":"Flips the operands of the string concatenation operator `.`. For example:\n\n```php\n'foo' . 'bar';\n```\n\nWill be mutated to:\n\n```php\n'bar' . 'foo';\n```","location":{"start":{"line":46,"column":13},"end":{"line":46,"column":98}},"status":"NoCoverage","statusReason":"","coveredBy":[],"killedBy":[],"testsCompleted":0},{"id":"f7fd1e06e2a9292b8f727e41459a18d5","mutatorName":"ConcatOperandRemoval","replacement":"throw new InstitutionNotFoundException($id->value());","description":"Removes an operand from a string concatenation.\n\n```php\n$x = 'foo' . 'bar';\n```\n\nWill be mutated to:\n\n```php\n$x = 'foo';\n```\n\nAnd:\n\n```php\n$x = 'bar';\n","location":{"start":{"line":46,"column":13},"end":{"line":46,"column":98}},"status":"NoCoverage","statusReason":"","coveredBy":[],"killedBy":[],"testsCompleted":0},{"id":"d0ddc0a90bc586c960dc68299b55c33e","mutatorName":"ConcatOperandRemoval","replacement":"throw new InstitutionNotFoundException('Institution not found by id ');","description":"Removes an operan rofileName;\nuse Core\\Profile\\Exceptions\\ProfileNotFoundException;\nuse Core\\Profile\\Exceptions\\ProfilesNotFoundException;\nuse Core\\Profile\\Infrastructure\\Persistence\\Eloquent\\Model\\Profile as ProfileModel;\nuse Core\\Profile\\Infrastructure\\Persistence\\Translators\\ProfileTranslator;\nuse Core\\SharedContext\\Infrastructure\\Persistence\\ChainPriority;\nuse Core\\SharedContext\\Model\\ValueObjectStatus;\nuse Exception;\nuse Illuminate\\Database\\DatabaseManager;\nuse Illuminate\\Database\\Eloquent\\Builder;\n\nclass EloquentProfileRepository implements ChainPriority, ProfileRepositoryContract\n{\n    private const PRIORITY_DEFAULT = 50;\n\n    private ProfileModel $model;\n\n    private ProfileTranslator $profileTranslator;\n\n    private DatabaseManager $database;\n\n    private int $priority;\n\n    public function __construct(\n        DatabaseManager $database,\n        ProfileTranslator $translator,\n        ProfileModel $model,\n        int $priority = self::PRIORITY_DEFAULT,\n    ) {\n        $this->database = $database;\n        $this->profileTranslator = $translator;\n        $this->model = $model;\n        $this->priority = $priority;\n    }\n\n    \/**\n     * @throws ProfileNotFoundException\n     * @throws Exception\n     *\/\n    public function find(ProfileId $id): Profile\n    {\n        $builder = $this->database->table($this->getTable());\n\n        $data = $builder->where('pro_id', $id->value())\n            ->where('pro_state', '>', ValueObjectStatus::STATE_DELETE)\n            ->first();\n\n        if (is_null($data)) {\n            throw new ProfileNotFoundException('Profile not found with id: '.$id->value());\n        }\n\n        $profileModel = $this->updateAttributesModelProfile((array) $data);\n\n        return $this->profileTranslator->setModel($profileModel)->toDomain();\n    }\n\n    \/**\n     * @throws ProfileNotFoundException\n     * @throws Exception\n     *\/\n    public function findCriteria(ProfileName $name): ?Profile\n    {\n        $builder = $this->database->table($this->getTable());\n        $builder->where('pro_name', $name->value())\n            ->where('pro_state', '>', ValueObjectStatus::STATE_DELETE);\n\n        $data = $builder->first();\n\n        if (is_null($data)) {\n            throw new ProfileNotFoundException('Profile not found with name: '.$name->value());\n        }\n\n        $profileModel = $this->updateAttributesModelProfile((array) $data);\n\n        return $this->profileTranslator->setModel($profileModel)->toDomain();\n    }\n\n    \/**\n     * @throws ProfilesNotFoundException\n     * @throws Exception\n     *\/\n    public function getAll(array $filters = []): Profiles\n    {\n        \/** @var Builder $builder *\/\n        $builder = $this->database->table($this->getTable());\n        $builder->where('pro_state', '>', ValueObjectStatus::STATE_DELETE);\n\n        if (array_key_exists('q', $filters) && isset($filters['q'])) {\n            $builder->whereFullText($this->model->getSearchField(), $filters['q']);\n        }\n\n        $profileCollection = $builder->get(['pro_id']);\n\n        if (is_null($profileCollection)) {\n            throw new ProfilesNotFoundException('Profiles not found');\n        }\n\n        $collection = [];\n        foreach ($profileCollection as $item) {\n            $profileModel = $this->updateAttributesModelProfile((array) $item);\n            $collection[] = $profileModel->id();\n        }\n\n        $profiles = $this->profileTranslator->setCollection($collection)->toDomainCollection();\n        $profiles->setFilters($filters);\n\n        return $profiles;\n    }\n\n    \/**\n     * @throws ProfileNotFoundException\n     * @throws Exception\n     *\/\n    public function deleteProfile(ProfileId $id): void\n    {\n        $builder = $this->database->table($this->getTable());\n        $builder->where('pro_id', $id->value());\n        $data = $builder->first();\n\n        if (is_null($data)) {\n            throw new ProfileNotFoundException('Profile not found with id: '.$id->value());\n        }\n\n        $profileModel = $this->updateAttributesModelProfile((array) $data);\n        $profileModel->changeState(ValueObjectStatus::STATE_DELETE);\n        $profileModel->changeDeletedAt(new \\DateTime);\n\n        $dataModel = $profileModel->toArray();\n        $builder->update($dataModel);\n\n        $profileDomain = $this->profileTranslator->setModel($profileModel)->toDomain();\n        $profileDomain->setModulesAggregator([]);\n        $this->syncPrivileges($profileDomain, $profileModel);\n    }\n\n    public function persistProfile(Profile $profile): Profile\n    {\n        $profileModel = $this->domainToModel($profile);\n        $profileId = $profileModel->id();\n        $dataModel = $profileModel->toArray();\n\n        $builder = $this->database->table($this->getTable());\n\n        if (is_null($profileId)) {\n            $profileId = $builder->insertGetId($dataModel);\n            $profile->id()->setValue($profileId);\n            $profileModel->changeId($profileId);\n        } else {\n            $builder->where('pro_id', $profileId);\n            $builder->update($dataModel);\n        }\n\n        $this->syncPrivileges($profile, $profileModel);\n\n        return $profile;\n    }\n\n    public function persistProfiles(Profiles $profiles): Profiles\n    {\n        return $profiles;\n    }\n\n    public function priority(): int\n    {\n        return $this->priority;\n    }\n\n    public function changePriority(int $priority): self\n    {\n        $this->priority = $priority;\n\n        return $this;\n    }\n\n    private function domainToModel(Profile $domain): ProfileModel\n    {\n        $builder = $this->database->table($this->getTable());\n        $builder->where('pro_id', $domain->id()->value());\n        $data = $builder->first();\n        $model = $this->updateAttributesModelProfile((array) $data);\n\n        $model->changeId($domain->id()->value());\n        $model->changeName($domain->name()->value());\n        $model->changeState($domain->state()->value());\n        $model->changeSearch($domain->search()->value());\n        $model->changeDescription($domain->description()->value());\n        $model->changeCreatedAt($domain->createdAt()->value());\n\n        if (! is_null($domain->updatedAt()->value())) {\n            $model->changeUpdatedAt($domain->updatedAt()->value());\n        }\n\n        return $model;\n    }\n\n    private function updateAttributesModelProfile(array $data = []): ProfileModel\n    {\n        $this->model->fill($data);\n        $this->model->exists = true;\n        return $this->model;\n    }\n\n    private function getTable(): string\n    {\n        return $this->model->getTable();\n    }\n\n    private function syncPrivileges(Profile $profile, ProfileModel $model): void\n    {\n        $profileId = $profile->id()->value();\n        $pivotTable = $model->pivotModules()->getTable();\n\n        $builder = $this->database->table($pivotTable);\n        $builder->where('pri__pro_id', $profileId);\n        $builder->delete();\n\n        foreach ($profile->modulesAggregator() as $item) {\n            $builder->insert([\n                'pri__pro_id' => $profileId,\n                'pri__mod_id' => $item\n            ]);\n        }\n    }\n}\n","mutants":[{"id":"ecd5e90804db9df72d3c404dafba428d","mutatorName":"IfNegation","replacement":"if (!is_null($data)) {","description":"Negates an expression in if statement.","location":{"start":{"line":56,"column":9},"end":{"line":58,"column":30}},"status":"Killed","statusReason":"PHPUnit 10.5.20 by Sebastian Bergmann and contributors.\n\nRuntime:       PHP 8.2.20\nConfiguration: \/tmp\/infection\/phpunitConfiguration.ecd5e90804db9df72d3c404dafba428d.infection.xml\n\nF\n\nTime: 00:00.078, Memory: 28.00 MB\n\nThere was 1 failure:\n\n1) Tests\\Feature\\Core\\Profile\\Infrastructure\\Persistence\\Repositories\\EloquentProfileRepositoryTest::test_find_should_return_object\nCore\\Pr ;\n        $this->model = $model;\n    }\n\n    \/**\n     * @throws Exception\n     *\/\n    public function find(UserId $id): ?User\n    {\n        $builder = $this->database->table($this->getTable())\n            ->where('user_id', $id->value())\n            ->where('user_state', '>', ValueObjectStatus::STATE_DELETE);\n        $data = $builder->first();\n\n        if (is_null($data)) {\n            throw new UserNotFoundException('User not found with id: '.$id->value());\n        }\n\n        $userModel = $this->updateAttributesModelUser((array) $data);\n\n        return $this->userTranslator->setModel($userModel)->toDomain();\n    }\n\n    \/**\n     * @throws Exception\n     *\/\n    public function findCriteria(UserLogin $login): ?User\n    {\n        $builder = $this->database->table($this->getTable())\n            ->where('user_login', $login->value())\n            ->where('user_state', '>', ValueObjectStatus::STATE_DELETE);\n        $data = $builder->first();\n\n        if (is_null($data)) {\n            throw new UserNotFoundException('User not found with login: '.$login->value());\n        }\n\n        $userModel = $this->updateAttributesModelUser((array) $data);\n\n        return $this->userTranslator->setModel($userModel)->toDomain();\n    }\n\n    \/**\n     * @throws Exception\n     *\/\n    public function persistUser(User $user): User\n    {\n        $userModel = $this->domainToModel($user);\n        $dataModel = $userModel->toArray();\n\n        $builder = $this->database->table($this->getTable());\n\n        $userId = $userModel->id();\n        if (is_null($userId)) {\n            $userId = $builder->insertGetId($dataModel);\n            $user->id()->setValue($userId);\n        } else {\n            $builder->where('user_id', $userId);\n            $builder->update($dataModel);\n        }\n\n        return $user;\n    }\n\n    public function priority(): int\n    {\n        return $this->priority;\n    }\n\n    public function changePriority(int $ ey($login));\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n            throw new UserNotFoundException('User not found by login '.$login->value());\n        }\n\n        if (! is_null($data)) {\n            $dataArray = json_decode($data, true);\n\n            \/** @var User *\/\n            return $this->userFactory->buildUserFromArray($dataArray);\n        }\n\n        return null;\n    }\n\n    \/**\n     * @throws UserNotFoundException\n     *\/\n    public function find(UserId $id): ?User\n    {\n        try {\n            $data = Redis::get($this->userKey($id));\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n            throw new UserNotFoundException('User not found by id '.$id->value());\n        }\n\n        if (! is_null($data)) {\n            $dataArray = json_decode($data, true);\n\n            \/** @var User *\/\n            return $this->userFactory->buildUserFromArray($dataArray);\n        }\n\n        return null;\n    }\n\n    \/**\n     * @throws UserPersistException\n     *\/\n    public function persistUser(User $user): User\n    {\n        $userLoginKey = $this->userLoginKey($user->login());\n        $userKey = $this->userKey($user->id());\n\n        $userData = $this->dataTransformer->write($user)->read();\n        try {\n            Redis::set($userLoginKey, json_encode($userData));\n            Redis::set($userKey, json_encode($userData));\n        } catch (Exception $exception) {\n            $this->logger->error($exception->getMessage(), $exception->getTrace());\n            throw new UserPersistException('It could not persist User with key '.$userKey.' in redis');\n        }\n\n        return $user;\n    }\n\n    public function priority(): int\n    {\n        return $this->priority;\n    }\n\n    public function changePriority(int $priority): self\n    {\n        $this->priority
